Description:
The Foxeer Echo Patch is an FPV Directional Receiver Antenna. It can be easily mounted on your FPV goggles and is lightweight so it won't stretch your neck.

&nbsp;

<strong>Specs:</strong>
Shell material: <strong>Imported PC + ABS</strong>
Weight: <strong>8g</strong>
Antenna length: <strong>21.7mm</strong>
Center frequency: <strong>5.8 GHz</strong>
Gain: <strong>8dBi</strong>
Radiation direction angle: <strong>84.7 degree</strong>
Bandwidth: <strong>500 MHz (5.5 – 6.0GHz)</strong>
Matching: <strong>VSWR &lt; 1.25 (at center frequency)</strong>
Impedance: <strong>50ohm</strong>
Axial ratio: <strong>&lt; 3</strong>
Center frequency: <strong>5600-5950MHz</strong>
Radiation efficiency: <strong>98%</strong>
Polarization: <strong>RHCP or LHCP</strong>
Connector: BOTH <strong>SMA &amp; RPSMA</strong>

&nbsp;

<strong>Includes:
</strong>1 x Foxeer Echo Patch
1 x SMA angle connector

